import React from 'react';

import { useNavigate  } from 'react-router-dom';

const BotaoVoltar = () => {
    const navigate = useNavigate();
  
    const handleGoBack = () => {
      navigate(-1); // Navega para a página anterior
    };
  
    return (
      <button onClick={handleGoBack}>
        Voltar
      </button>
    );
  };

export default BotaoVoltar;
